In de film wordt de draak gestoken met bekende films als Gladiator, Troy en 300. We volgen de belevenissen van Awesomest Maximus (Will Sasso), die een uitgerangeerde Spartaanse generaal is, en Testiclees (Ian Ziering) die alleen verwond kan worden door hem te raken in zijn edele delen. Maximus probeert zijn weg naar de eeuwige roem te vinden, maar door zijn constante falen komt hij telkens maar niet verder.

Vertaling JR Jansen

